import { useParams, useNavigate } from 'react-router-dom';
import { useState } from 'react';

const ProjectDetail = () => {
  const { projectName } = useParams();
  const navigate = useNavigate();
  const decodedName = decodeURIComponent(projectName);

  const [newName, setNewName] = useState('');
  const [selectedFile, setSelectedFile] = useState(null);

  // üìé Upload document
  const handleFileUpload = async () => {
    if (!selectedFile) return alert('Please select a file to upload.');

    const formData = new FormData();
    formData.append('file', selectedFile);
    formData.append('projectName', decodedName);

    try {
      const res = await fetch('http://localhost:2000/api/projects/upload', {
        method: 'POST',
        body: formData,
      });
      const data = await res.json();
      alert(data.message || 'File uploaded successfully.');
    } catch (err) {
      console.error('Upload error:', err);
      alert('File upload failed.');
    }
  };

  // ‚úèÔ∏è Rename project
  const handleRename = async () => {
    if (!newName.trim()) return alert('Enter a new project name.');

    try {
      const res = await fetch('http://localhost:2000/api/projects/rename', {
        method: 'PUT',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ oldName: decodedName, newName }),
      });
      const data = await res.json();
      alert(data.message || 'Project renamed.');
      navigate(`/projects/${encodeURIComponent(newName)}`);
    } catch (err) {
      console.error('Rename error:', err);
      alert('Rename failed.');
    }
  };

  // üóëÔ∏è Delete project
  const handleDelete = async () => {
    if (!window.confirm(`Are you sure you want to delete "${decodedName}"?`)) return;

    try {
      const res = await fetch('http://localhost:2000/api/projects/delete', {
        method: 'DELETE',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ projectName: decodedName }),
      });
      const data = await res.json();
      alert(data.message || 'Project deleted.');
      navigate('/projects');
    } catch (err) {
      console.error('Delete error:', err);
      alert('Delete failed.');
    }
  };

  // üì§ Share document (Mocked copy-to-clipboard link)
  const handleShare = () => {
    const shareableLink = `http://localhost:3000/projects/${encodeURIComponent(decodedName)}`;
    navigator.clipboard.writeText(shareableLink);
    alert('Link copied to clipboard: ' + shareableLink);
  };

  return (
    <>
      <button onClick={() => navigate(-1)} className="back-button">
        ‚Üê Back
      </button>

      <h1 className="header">{decodedName}</h1>

      <div className="project-detail-wrapper">
        <p>Here you can:</p>
        <ul>
          <li>
            üìé <strong>Attach relevant documents</strong><br />
            <input type="file" onChange={(e) => setSelectedFile(e.target.files[0])} />
            <button onClick={handleFileUpload}>Upload</button>
          </li>

          <li>
            ‚úèÔ∏è <strong>Rename the project</strong><br />
            <input
              type="text"
              value={newName}
              placeholder="Enter new name"
              onChange={(e) => setNewName(e.target.value)}
            />
            <button onClick={handleRename}>Rename</button>
          </li>

          <li>
            üóëÔ∏è <strong>Delete the project</strong><br />
            <button onClick={handleDelete} style={{ color: 'red' }}>
              Delete
            </button>
          </li>

          <li>
            üì§ <strong>Share the documents</strong><br />
            <button onClick={handleShare}>Copy Shareable Link</button>
          </li>
        </ul>
      </div>
    </>
  );
};

export default ProjectDetail;
